def saveToExcel(data, sportName, taskName, taskType=""):
    if DBManager.is_initialized():
        saveToDatabase(data, sportName, taskName, taskType)
        return

    file_name = "result/{}.xlsx".format(sportName)
    sheet_name = SHEET_NAMES[taskName]
    try:
        wb = openpyxl.load_workbook(file_name)
    except:
        print("can't open file-\"{}\"...".format(file_name))
        return

    if sheet_name in wb.sheetnames:
        ws = wb[sheet_name]
        header = False
    else:
        ws = wb.create_sheet(sheet_name)
        header = True

    if isinstance(data, dict):
        df = pd.DataFrame(data, index=[0], columns = ColumnNamesForTasks(sportName, taskName))
    elif isinstance(data, list):
        df = pd.DataFrame(data, columns = ColumnNamesForTasks(sportName, taskName))

    cnt = 0
    for row in dataframe_to_rows(df, index=False, header=header):
        ws.append(row)
        cnt += 1

    try:
        wb.save(file_name)
        wb.close()
        print("Added {} rows into {}-{} sheet...".format(cnt, file_name, sheet_name))
    except:
        print("can't save data into excel, since it is opened or using from other process...")

def readDataFromExcel(fileName, sheetName):
    # wb = openpyxl.load_workbook(fileName)
    # ws = wb[sheetName]
    # result = []

    dfs = pd.ExcelFile(fileName, sheetName=sheetName, header=[0, 1])
    data = []
    for index, row in dfs.iterrows():
        record = {}
        for col in dfs.columns.get_level_values(1):
            record[col] = row[col]
        data.append(record)

    return data

