def loadTaskFromExcel(sportName, taskName, taskType):
    fileName = "result/{}.xlsx".format(sportName)
    try:
        df = pd.read_excel(fileName, SHEET_NAMES[PRIO_TASKS[taskName]])
        data = []
        if taskName == "countries":
            pass
        elif taskName == "leagues":
            for row in dataframe_to_rows(df, index=False, header=False):
                data.append((row['Country Id'], row['Country Name']))
        elif taskName == "seasons":
            for row in dataframe_to_rows(df, index=False, header=False):
                data.append((row['League Id'], row['League Link'], "*"))
        elif taskName == "matches":
            for row in dataframe_to_rows(df, index=False, header=False):
                data.append(row['Season Link'])
        elif taskName == "statistics":
            for row in dataframe_to_rows(df, index=False, header=False):
                data.append(row[2])
        elif taskName == "players":
            pass

        return data
    except Exception as e:
        print("Exception occured in Loading tasks from excel : ", e)
        return []

def loadTasks(sportName, taskName, taskType = "all"):
    DBtasks = loadTaskFromDB(sportName, taskName, taskType)
    return DBtasks
    ExcelTasks = loadTaskFromExcel(sportName, taskName, taskType)
    return ExcelTasks
