def divide_chunks(l, n):
    for i in range(0, len(l), n):
        yield l[i:i + n]

def makeStatisticsKey(sportName, idx, team, key):
    if sportName == "american-football":
        res = "_".join([team, STAT_NAMES[sportName][idx]] + key.upper().split())
    else:
        res = "_".join([STAT_NAMES[sportName][idx], team] + key.upper().split())
    return res

def insertCountryIntoDatabase(sportName, taskName):
    fileName = "result/{}.xlsx".format(sportName)
    try:
        df = pd.read_excel(fileName, SHEET_NAMES[sportName][taskName])

        for index, row in df.iterrows():
            sql = "UPDATE `country` SET `name` = %s, `link` = %s WHERE `id`=%s"
            DBManager.update(sql, row['Country Name'], row['Country Link'], row['Country Id'])
    except Exception as e:
        print("Exception - ", e)

